 ('51', '55', 'en', 'Ramen på Finnes torsdag 21. september', NULL, NULL, NULL, 'left', NULL, '<p>Finnes Kafé is serving Ramen again on the 21st of September, and this time we\'ll make sure that we have enough noodles to serve everyone who visits us! <br /></p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"en\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Ramen p\\u00e5 Finnes torsdag 21. september\",\"seoDescription\":\"Finnes Kaf\\u00e9 is serving Ramen again on the 21st of September, and this time we\'ll make sure that we have enough noodles to serve everyone who visits us!\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"54\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Ramen p\\u00e5 Finnes torsdag 21. september\",\"seoDescriptionUnparsed\":\"Finnes Kaf\\u00e9 is serving Ramen again on the 21st of September, and this time we\'ll make sure that we have enough noodles to serve everyone who visits us!\\u00a0\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__