 ('52', '56', 'en', NULL, '<p>Ramen will be served from 12PM - 8PM, and the price will be 150NOK. No reservation is needed and we are looking forward to welcome you all!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-09-21 10:14:10', '2018-01-12 12:32:27', '335e9122-5796-45d4-8e56-995e91c6942d'),
