:32:17', 'a706520c-86e5-472e-b4ee-506f8bac0782'),
 ('77', '84', 'en', NULL, '<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert på det mest interessante og beste vi får levert, fra dag til dag. Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 11:58:11', '2018-01-12 12:32:17', '0b870d27-e0f3-4498-8f79-b9d0e6d9000a'),
 ('78', '85', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 11:58:11', '2018-01-12 12:32:17', 'cd7c4415-3752-4c06-a70f-8b644dbb1812'),
 ('79', '86', 'en', NULL, '<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert på det mest interessante og beste vi får levert, fra dag til dag. Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.</p>', 'En liten mellomtittel', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 12:04:13', '2018-01-12 12:32:17', '0bb4e9af-f54f-4d8b-9c07-a27f0e5bd311'),
 ('80', '87', 'en', NULL, '<p>Råvarene er motivasjonen vår. Hvorfor skulle vi ellers betale 260 kroner per kilo smør? Med rent håndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, på gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, månen, sjøen, kroppen.<br /></p>', 'Vegen videre', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 12:04:13', '2018-01-12 12:32:17', '7fe950f0-2a3c-4b9d-afa8-f0db8766ad8c'),
