 ('83', '90', 'en', 'Skjølberg Søndre, Svorkmo', NULL, NULL, NULL, 'left', NULL, '<p>Skjølberg Søndre er en biodynamisk kretsløpsgård som drives av Elin Östlund og Carl Erik Skjølberg. </p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"en\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"seoDescription\":\"Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg.\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"125\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"seoDescriptionUnparsed\":\"Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg.\\u00a0\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '2017-12-15 12:08:02', '2018-01-12 13:02:39', '57dba44c-5d7b-4def-98d6-e6024ba70c9f'),
 ('84', '91', 'en', NULL, '<p>Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. Å plukke rene, ærlige grønnsaker og urter med egne hender er et høydepunkt for oss som kokker, og vi setter svært stor pris på kunnskapen som Skjølberg Søndre viser oss om agro-økologisk jordbruk.</p><p><a href=\"http://www.skjolbergsondre.no/\">www.skjolbergsondre.no</a></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 12:08:02', '2018-01-12 13:02:39', 'c2c70baf-c490-4313-a423-2bced97e1a82'),
