 ('88', '95', 'en', NULL, '<p>Credo jobber svært tett med historiker og gårdbruker Jon Fredrik Skauge. Blant flere råvarer henter vi ukentlig nykinnet smør, fersk melk, rømme og kjøtt – alt fra gårdens sidete Trønderfe. De ulike sesongene gir råvarer som endrer smak hele tiden, til vår store begeistring.<br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 12:10:33', '2017-12-15 14:19:55', '680635e8-bcdf-4cff-97b3-ed1b0d3be16e'),
