 ('95', '102', 'en', NULL, '<p>På Credo skal du få mat laget på råvarer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert på måter der smak og bærekraft er viktige elementer.<br /></p>', 'Credos hjerte ligger der råvarene produseres.', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '2017-12-15 12:34:47', '2018-01-10 12:12:03', '927c9b8d-ba62-4b17-874f-1a5c0fddb000'),
