 ('97', '104', 'en', NULL, '<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert på det mest interessante og beste vi får levert, fra dag til dag. Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.<br /></p>\n<p>Med nær kontakt til produsentene våre og med en etisk tilnærming til det vi gjør, søker vi kontinuerlig utvikling mot bærekraft. Vi tror veldig på at dette gjenspeiler seg i smak. <br /></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 12:34:47', '2018-01-10 12:12:03', '488467dd-66d3-4bef-a537-36ccfdc14acb'),
 ('98', '105', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 12:34:47', '2018-01-10 12:12:03', 'b5cb41db-4d7d-4a4e-b7f5-8687b2281ab9'),
 ('99', '106', 'en', NULL, '<p>Råvarene er motivasjonen vår. Hvorfor skulle vi ellers betale 260 kroner per kilo smør? Med rent håndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, på gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, månen, sjøen, kroppen.<br /></p>\n<p>Vi tar deg nært til smaker, teksturer og følelser. Vi ønsker å integrere deg og kretsløpene som gårdene våre representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er på.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-15 12:34:47', '2018-01-10 12:12:03', '8d1bd7b7-570d-4b39-a10a-dd51cbc44a9a'),
