 ('147', '154', 'en', NULL, '<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus på menneskene som maten, bøndene og dyrene, med kjøtt og fisk tilberedt i samme mål, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrød, andebryst, stekte torskehoder og rabarbraslush.</p>', 'Historien', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2017-12-17 19:27:46', '2018-01-10 15:09:48', '9354d70e-17c0-46ad-a115-b34b62beb70a'),
