 ('161', '171', 'en', 'Heidi', NULL, NULL, NULL, 'left', NULL, '<p>Heidi Bjerkan er en norsk kokk, kjøkkensjef og medeier. Hun åpnet Credo Restaurant i Credoveita, Trondheim i 1998.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"en\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Heidi\",\"seoDescription\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"174\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '2018-01-10 11:28:00', '2018-01-15 18:26:33', 'a2721b91-a4b7-446e-a419-234238b9d7f6'),
 ('162', '172', 'en', NULL, '<p>Heidi Bjerkan vokste opp i Trondheim og i båten til bestefaren på Garten - trøndelagskysten. Her knyttet hun sterke bånd til jord og vann, som siden er å se i hennes matlaging. For Heidi Bjerkan er det bøndene som er heltene, og det er produsentene som skal skinne. Gjennom måltidet på Credo tar hun med alle gjestene på hennes tur gjennom gårdene, sjøen og skogen der råvarene kommer fra.</p>\n<p>Heidi Bjerkan engasjerer seg for mer kunnskap, for bedre landbruk og for større interesse for tradisjoner, og Heidi Bjerkan fikk i år Matprisen for sitt engasjement for bedre mat og et bedre landbruk.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 11:28:00', '2018-01-15 18:26:33', 'a531715c-77e3-442e-be2a-2f81ed4ba2bc'),
