 ('200', '210', 'en', 'Viva Mexico', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 15:49:02', '2018-01-10 15:49:02', '8a715b9e-1adf-4e86-9c6f-f9a4b964909b'),
 ('201', '211', 'en', 'Viva Mexico', NULL, NULL, NULL, 'left', NULL, '<p>Etter et lengre opphold på hjemmebane, hvor Jossa har nytt godt av både sild, svinekjøtt og akevitt, pakker Jossa kofferten og sikter mot varmere strøk. Jossa har savnet tropiske frukter, de eksotiske smakene og ikke minst de livlige rytmene – Mexico, watch out!</p>', '0', '0', '0', '0', '', '2018-01-10 15:49:36', '2018-01-10 15:49:36', 'e5bafa48-8a9a-425f-9c53-2dd986bc4d95'),
 ('202', '212', 'en', NULL, '<p>Jossa ser ut over skyene og drømmer om deilig salsa, tamales, mole og for ikke å glemme den mexicanske guacemolen. Hun klarer nesten ikke å sitte stille, og kjenner hun er klar for å sette beina på meksikans jord.<br /></p>\n<p>På let etter ny inspirasjon trekker Jossa pusten idet havbrisen glir forbi og sandkornene kiler lett under føttene. Endelig i Mexico, and first – TACOS!\n  </p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 15:49:36', '2018-01-10 15:49:36', '31afe89d-81aa-4c7e-8876-f690f47ce771'),
 ('203', '213', 'en', 'Thailand Laos', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 15:50:51', '2018-01-10 15:50:51', 'cf6c50d7-26f3-4020-ba90-d1738060e445'),
 ('204', '214', 'en', 'Jossa på vei til Thailand & Laos', NULL, NULL, NULL, 'left', NULL, '<p>Vel tilbake fra Mexico ble ikke lysten på eventyr mettet for Jossa.</p>', '0', '0', '0', '0', '', '2018-01-10 15:51:49', '2018-01-10 15:51:49', 'e878825a-3280-4c17-860f-2d8c57a5fae0'),
 ('205', '215', 'en', NULL, '<p>Koffertene er ikke ferdig utpakket før at utstyret pakkes ned igjen og nye reisemål står for tur, for savnet etter de friske urtene, sterke kryddrene og de lekne smakene fører Jossa til big Thailand og Laos!</p>\n<p>Nam prik pao, pad thai og gaeng phed ped yang er bare noen av rettene som står på smaksagendaen for reisen, og Jossa får vann i munnen av tanken.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 15:51:49', '2018-01-10 15:51:49', '71d5a0ab-e866-4a6d-841c-ba7b5dffaeea'),
 ('206', '216', 'en', 'Finnes Gronne Omgivelser', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 15:55:47', '2018-01-10 15:55:47', '8ef3837b-8c40-4db5-a2cc-35703b680001'),
 ('207', '217', 'en', 'Grønne omgivelser ', NULL, NULL, NULL, 'left', NULL, '<p>Vel i hus på Finnes Kafé så blomstrer det for fullt i parsellhagen på Lilleby.<br /></p>', '0', '0', '0', '0', '', '2018-01-10 15:56:35', '2018-01-10 15:56:35', '7198c92c-98b9-45b9-8f78-67f9e74af6b7'),
 ('208', '218', 'en', NULL, '<p>Friske urter, nydelige blomster og nyttevekster som folk flest bare kan drømme om er lett tilgjengelig like utenfor døra – For en LUKSUS!</p>\n<p>Lilleby Hagelag, i samarbeid med kretsløpsgården Skjølberg Søndre holder hagen i sjakk, og til vår fornøyelse sørger de for friske og grønne omgivelser rundt Finnes Kafé, Jossa mat &amp; drikke og Credo Restaurant.</p>\n<p>Alle som ønsker kan bli med i Lilleby Hagelag, og for mer informasjon, ta kontakt på <a href=\"mailto:post@lillebyhagelag.no\">post@lillebyhagelag.no</a></p>\n<p> \n  </p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 15:56:35', '2018-01-10 15:56:35', 'a82265bc-f0ba-4582-a293-5ca4af7ea097'),
 ('209', '219', 'en', 'Brod Finnes Snitt', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 15:59:12', '2018-01-10 15:59:12', '02c7177a-e9da-47c2-a78c-7b494151e6d2'),
 ('210', '220', 'en', 'Baking Finnes', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 15:59:37', '2018-01-10 15:59:37', '635491ff-ccb0-4f42-86ea-d86338791d17'),
 ('211', '221', 'en', 'Brod Finnes', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 16:00:49', '2018-01-10 16:00:49', '8178983f-7673-4527-92dd-58d1e097c31b'),
 ('212', '222', 'en', 'Finnes bakeri', NULL, NULL, NULL, 'left', NULL, '<p>Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Brød Surdeigsbakeri* startet vi opp et lite håndtverksbakeri på Finnes Kafé i September 2017.</p>', '0', '0', '0', '0', '', '2018-01-10 16:00:53', '2018-01-10 16:03:51', 'fe54a911-edb8-4a0e-9801-5d6a473c21a8'),
 ('213', '223', 'en', NULL, '<p>Bakeriet har fokus på naturlig hevet brød – SURDEIGSBRØD – og brødene er utelukkende laget på norsk mel og kornarter. Spelt, Havre, Emmer, og røkt bygg er bare noen alternativer som er å få på kafeen.</p>\n<p> *Ille Brød Surdeigsbakeri (<a href=\"https://www.facebook.com/illebrod/)\">https://www.facebook.com/illebrod/)</a> er et surdeigsbakeri lokalisert i Oslo. De lager naturlig hevet brød og tar utelukkende i bruk lokalt dyrket mel og urkorn. Bakeriet holder til i Lakkegata 53, Oslo, og vi anbefaler hele Oslos befolkning, og alle tilreisende å ta turen innom bakeriet for en smak av byens beste brød!</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 16:00:53', '2018-01-10 16:03:51', '0d118a6f-b1a7-4e2c-a688-2acba0df9d68'),
 ('214', '224', 'en', 'Fossan Brod', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 16:01:57', '2018-01-10 16:01:57', '8799b3de-a3f5-4169-acca-50bd4b37ef51'),
 ('216', '226', 'en', 'Fossan Brød', NULL, NULL, NULL, 'left', NULL, '<p>Fossan Mølle er en perle av mølleverk fra 1936 lokalisert i Skjelstadmarka i Trøndelag.</p>', '0', '0', '0', '0', '', '2018-01-10 16:03:40', '2018-01-10 16:03:40', '6ff3d674-e5ba-471d-9293-9b4a23298d23'),
 ('217', '227', 'en', NULL, '<p>Den ble til da selve turbinen møllen består av, ble fraktet med jernbane til Hegra, og deretter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan Mølle av Petter Fossan, og matmel blir fortsatt malt i denne gamle mølla. Finnes Kafé ønsker å sette lys på denne gamle perlen, og til vår store begeistring får vi oppdage melet i brødbaksten vår. Vi har utforsket med ulike melsorter fra Fossan Mølle, og eksperimentene har resultert i et eget ”Fossan Brød” som er til salgs i kafeen!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '2018-01-10 16:03:40', '2018-01-10 16:03:40', '5556681b-f81b-44ae-8893-131a4837e437'),
