 ('138', '94', '3', '49', 'en', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fannremsg\\u00e5rden, Orkdal\",\"slug\":\"fannremsgarden\",\"postDate\":1513339800,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"92\"],\"10\":\"<p>Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.<br><\\/p>\",\"3\":{\"95\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"93\"],\"standardBodyText\":\"<p>Credo jobber sv\\u00e6rt tett med historiker og g\\u00e5rdbruker Jon Fredrik Skauge. Blant flere r\\u00e5varer henter vi ukentlig nykinnet sm\\u00f8r, fersk melk, r\\u00f8mme og kj\\u00f8tt \\u2013 alt fra g\\u00e5rdens sidete Tr\\u00f8nderfe. De ulike sesongene gir r\\u00e5varer som endrer smak hele tiden, til v\\u00e5r store begeistring.<br><\\/p>\",\"settingImagePosition\":\"left\"}}},\"16\":\"\"}}', '2017-12-15 14:19:55', '2017-12-15 14:19:55', 'd2b78571-316c-49a0-828e-a7e071ea88e2'),
 ('139', '90', '3', '49', 'en', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"slug\":\"skjolberg-sondre\",\"postDate\":1513339680,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\"],\"4\":[\"125\"],\"10\":\"<p>Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg.&nbsp;<\\/p>\",\"3\":{\"91\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"89\"],\"standardBodyText\":\"<p>Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. \\u00c5 plukke rene, \\u00e6rlige gr\\u00f8nnsaker og urter med egne hender er et h\\u00f8ydepunkt for oss som kokker, og vi setter sv\\u00e6rt stor pris p\\u00e5 kunnskapen som Skj\\u00f8lberg S\\u00f8ndre viser oss om agro-\\u00f8kologisk jordbruk.<br><a href=\\\"http:\\/\\/www.skjolbergsondre.no\\/\\\">www.skjolbergsondre.no<\\/a><\\/p>\",\"settingImagePosition\":\"left\"}}},\"16\":\"\"}}', '2017-12-15 14:20:17', '2017-12-15 14:20:17', '6247bd66-87a2-4f96-bec7-e9da668e1c36'),
