:\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"94\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}}},\"19\":\"\",\"18\":\"\"}}', '2018-01-10 09:35:42', '2018-01-10 09:35:42', 'bf2c2233-4916-4eb4-be0f-3ab1515ec169'),
