 ('201', '22', '4', '49', 'en', '3', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Karriere\",\"slug\":\"kontakt\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"9\",\"fields\":{\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Karriere\",\"standardImages\":[\"160\"],\"standardBodyText\":\"<p>Vi er alltid p\\u00e5 utkikk etter nye, engasjerte ansatte som \\u00f8nsker \\u00e5 bli en del av Credo-familien.<\\/p>\\r\\n<p>Hvis du \\u00f8nsker \\u00e5 s\\u00f8ke en stilling eller har noen sp\\u00f8rsm\\u00e5l, ta kontakt med administrasjonskoordinator: career@restaurantcredo.no<\\/p><p><\\/p>\",\"settingTextWhiteBox\":\"1\"}}},\"19\":\"\",\"18\":\"\"}}', '2018-01-10 13:22:13', '2018-01-10 13:22:13', 'e3087ca9-04b9-46be-b679-5ccae31850bf'),
 ('202', '13', '4', '49', 'en', '3', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Karriere\",\"slug\":\"kontakt\",\"postDate\":1505469300,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"8\",\"fields\":{\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Karrierere\",\"standardImages\":[\"160\"],\"standardBodyText\":\"<p>Vi er alltid p\\u00e5 utkikk etter nye, engasjerte ansatte som \\u00f8nsker \\u00e5 bli en del av Credo-familien.<\\/p>\\r\\n<p>Hvis du \\u00f8nsker \\u00e5 s\\u00f8ke en stilling eller har noen sp\\u00f8rsm\\u00e5l, ta kontakt med administrasjonskoordinator: <a href=\\\"mailto:career@restaurantcredo.no\\\" target=\\\"_blank\\\">career@restaurantcredo.no<\\/a><\\/p>\",\"settingTextWhiteBox\":\"1\"}}},\"19\":\"\",\"18\":\"\"}}', '2018-01-10 13:23:24', '2018-01-10 13:23:24', 'c2687b25-aa6b-4021-8401-2b8af1d0a74a'),
 ('203', '17', '4', '49', 'en', '12', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Karriere\",\"slug\":\"kontakt\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"74\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Karriere\",\"standardImages\":[\"176\"],\"standardBodyText\":\"<p>Vi er alltid p\\u00e5 utkikk etter nye, engasjerte ansatte som \\u00f8nsker \\u00e5 bli en del av Credo-familien.<\\/p>\\r\\n<p>Hvis du \\u00f8nsker \\u00e5 s\\u00f8ke en stilling eller har noen sp\\u00f8rsm\\u00e5l, ta kontakt med administrasjonskoordinator: <a href=\\\"mailto:career@restaurantcredo.no\\\" target=\\\"_blank\\\">career@restaurantcredo.no<\\/a><\\/p>\",\"settingTextWhiteBox\":\"1\"}}},\"19\":\"\",\"18\":\"\"}}', '2018-01-10 13:27:32', '2018-01-10 13:27:32', '2fedeed7-016f-42de-84a1-a71e77cf6420'),
 ('204', '189', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Jossa til \\u00d8sterike\",\"slug\":\"jossa-til-osterike\",\"postDate\":1515593226,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"188\"],\"10\":\"<p>Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.&nbsp;<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Tobias har sagt farvel for kort tid siden. Han takket for selskapet, ga henne en god klem og trykket en gave ned i sekken. \\u2013 Du m\\u00e5 ikke \\u00e5pne den pakken f\\u00f8r du er fremme. Tobias s\\u00e5 p\\u00e5 Jossa og smilte.\\r\\n\\u2013 God tur, og hils &nbsp;til Werner.<\\/p>\\r\\n<p>Jossa klatrer om bord i toget og finner kupeen sin. Nattoget til malm\\u00f8, en behagelig m\\u00e5te \\u00e5 reise p\\u00e5, og fra Malm\\u00f8 er det ikke langt til kontinentet. Hun bryter av skalken p\\u00e5 br\\u00f8det og legger seg p\\u00e5 den oppredde senga. F\\u00f8ttene er m\\u00f8re etter all vandringen.&nbsp;Hun forsvinner inn i s\\u00f8vnen samtidig med togets startende bevegelser. Som et barn blir hun dysset i s\\u00f8vn, f\\u00f8r hun selv hadde tenkt. Det er m\\u00f8rkt, varmt og behagelig.<\\/p>\\r\\n<p>Det spraker i en h\\u00f8yttaler, plinger i en bjelle og det bankes p\\u00e5 d\\u00f8ren. Det f\\u00f8les som om det er samtidig, men hun tar det p\\u00e5 oppv\\u00e5kingsfasen, at hun har duppet av mellom lydene, bare fortrengt det litt.\\r\\nMalm\\u00f8, den kom raskere enn hun trodde, hele byen ligger der, foran henne, flat som den er.\\r\\nHun har b\\u00f8rstet av seg smulene fra br\\u00f8dskalken, skiftet, tatt en kattevask og pr\\u00f8vd \\u00e5 legge h\\u00e5ret stramt slik det s\\u00f8mmer seg, f\\u00f8r hun gikk av toget.<\\/p>\\r\\n<p>B\\u00e5ten venter, b\\u00e5ten til kontinentet st\\u00e5r i havna, noen hundre meter bortenfor stasjonen.\\r\\nFra K\\u00f8benhavn ble det tog til wien, med bytte i m\\u00fcnchen, Jossa var utmattet men merket seg at K\\u00f8benhavn var en by hun skulle utforske, men da p\\u00e5 vei hjem.<\\/p>\\r\\n<p>Brosteinen og kumlokkene, de er fine. Jossa ser ned mens hun tusler ut av stasjonsbygget i Wien.\\r\\nMen jeg er sulten. Sier hun h\\u00f8yt til seg selv, s\\u00e5 den d\\u00f8sige mannen som sto rett ved siden av i sin egen verden skvetter til og ser p\\u00e5 henne.\\r\\n\\u2013 unnskyld, sier han.\\r\\n\\u00c5h, nei \\u2013 det var ikke meningen, men jeg er bare litt sulten. Eller hvis jeg skal si det som sant er, jeg er skrubbsulten.\\r\\nHun hadde helt glemt \\u00e5 spise, helt glemt at hun var sulten n\\u00e5r hun l\\u00f8p fra b\\u00e5t til tog i K\\u00f8benhavn, og i M\\u00fcnchen ble det akkurat tid nok til en p\\u00f8lse med sauerkraut.\\r\\nHaha! Mannen smiler til, det glimter i gull bakerst i munnen\\r\\n\\u2013 Du har kommet til rett sted. Kom bli med meg.\\r\\n-Unnskyld, jeg glemte meg helt bort. Hvor er mine manerer, uff , Werner heter jeg fr\\u00f8ken. &nbsp;Han strekker ut en h\\u00e5nd. Jossa griper den og kjenner det faste h\\u00e5ndtrykket. Jossa sier hun, og smiler.<\\/p>\\r\\n<p>De n\\u00e6rmest sm\\u00e5l\\u00f8per innover byen. Jossa klarer ikke f\\u00e5 med seg noe, hun tenker bare p\\u00e5 mat.\\r\\n\\u2013 Hva skal du her i Wien ?\\r\\n\\u2013 Jeg skal spise, jeg vil smake det som er \\u00f8sterisk. Det er det som er reisen min skj\\u00f8nner du, jeg vil finne ut av hva ting smaker p\\u00e5 forskjellige steder.\\r\\nWerner stopper litt, mens han tenker.\\r\\n\\u2013 S\\u00e5 du vil smake det som er mest Wiensk, ok, men da tar vi til h\\u00f8yre her.\\r\\nDu skal f\\u00e5 Sp\\u00e4tzle, og det er best p\\u00e5 et bitte lite sted rett her borte.<\\/p>\\r\\n<p>De sm\\u00e5l\\u00f8per videre, litt uten grunn, men drevet av sult og nysgjerrighet.&nbsp;Sp\\u00e4tzle, en slags urpasta, eller gnocchi, eller en blanding av de begge.&nbsp;N\\u00e5r Werner forteller om smaken, den smeltede osten og ikke minst vinen som skal drikkes til g\\u00e5r det nesten rundt for Jossa.<\\/p>\\r\\n<p>Endelig skal hun f\\u00e5 mat.\\r\\nWerner dumper ned i stolen ved siden av henne.\\r\\n\\u2013 S\\u00e5nn, vin og mat p\\u00e5 vei. Du er skikkelig sulten ? Jossa klarer knapt \\u00e5 ytre ja, hun venter bare p\\u00e5 noe \\u00e5 spise.\\r\\n\\u2013 Jeg bestillte litt forskjellig, s\\u00e5 du skal f\\u00e5 et raskt overblikk, det blir kanskje litt mye. Men det kommer noen andre venner av meg ogs\\u00e5, som kan mer om vin, s\\u00e5 da spiser han det vi ikke klarer. Ok? Werner har tatt kommandoen og ser ut til \\u00e5 kose seg i rollen som vertskap. \\u2013 Grillet kalvetunge med syltede gr\\u00f8nnsaker, Sp\\u00e4tzle med sopp og ost, Gresskarsuppe med krepse-dumplings, P\\u00f8lse med sauerkraut, Snitzel med potetsalat og sitron, R\\u00f8ye med k\\u00e5l, og til dessert f\\u00e5r du Schwartswaldkake med kirseb\\u00e6r ogs\\u00e5 kan du ikke unng\\u00e5 strudelen da. Den m\\u00e5 du smake n\\u00e5r du er i Wien .\\r\\nJossa rister p\\u00e5 hodet og ler.\\r\\n\\u2013 Jeg klarer jo ikke alt sammen, det er jo umulig.<\\/p>\"}}},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 14:07:06', '2018-01-10 14:07:06', '9b6e034c-ad4f-4b90-9cfa-8c076eb00b2d'),
 ('205', '192', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Jossa til Sverige\",\"slug\":\"jossa-til-sverige\",\"postDate\":1515593310,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"191\"],\"10\":\"<p>Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim.&nbsp;N\\u00e5 har hun endelig m\\u00f8tt Tobias, en som er kjent i dalen.<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>\\u2013 Jaha du, s\\u00e5 du er ute etter den svenske smaken du, sier Tobias p\\u00e5 slepent svensk m\\u00e5l.<br>Jossa har spurt og gravd for \\u00e5 finne den som lager den beste maten p\\u00e5 denne siden av grensen.<\\/p>\\r\\n<p>\\u2013 S\\u00e5 de sier det ja. Hehe.&nbsp;Tobias ler mens han plukker opp noe som kan virke som en vilk\\u00e5rlig blomst fra bakken.Han smaker og smatter.<br>\\u2013 At jeg er den du skal snakke med ja.<br>Jossa smiler oppr\\u00f8mt, og nikker.<br>\\u2013 Den kommer herfra. Det er i jorden alt starter, det er der alt opprinner. S\\u00e5 vi m\\u00e5 bevege oss litt rundt.<\\/p>\\r\\n<p>De fortsetter ferden nedover, mot et forgjettet sted, mot en g\\u00e5rd som det g\\u00e5r flotte ord om rundt i hele verden.<br>\\u2013 For at du skal forst\\u00e5 hva de gj\\u00f8r akkurat der, s\\u00e5 m\\u00e5 vi nesten spise et par ting p\\u00e5 veien.<\\/p>\\r\\n<p>Tobias lister opp hva Jossa skal smake&nbsp;-Raggmunk med Vesterbotten,&nbsp;Sild med egg, poteter, rug og r\\u00f8dbeter , sild ost og sm\\u00f8r,&nbsp;Falukorv,&nbsp;Flesk, rotmos, l\\u00f8k,&nbsp;Fisk med Skagensaus.&nbsp;<br>Dette er veldig kjente smaker, men Raggmunk, det er jeg usikker p\\u00e5.<br>Han ler, mens han henter ut en potet fra sekken. Raggmunk, det er nesten det beste du kan gj\\u00f8re med poteter.<br>Men kom n\\u00e5, s\\u00e5 spiser vi. S\\u00e5 f\\u00e5r du oppskriftenen p\\u00e5 alt, som du kan ta med deg hjem igjen.<\\/p><p><\\/p>\"}}},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 14:08:30', '2018-01-10 14:08:30', 'c1663806-ff10-49f8-94a5-23c84c08323b'),
 ('206', '195', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Jossa p\\u00e5 hjemmebane\",\"slug\":\"jossa-pa-hjemmebane\",\"postDate\":1515593400,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"194\"],\"10\":\"<p>Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige lufta.<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p><\\/p><p>Hun ser havnen i det fjerne, og tusler ned i kahytten.<br>\\u2013 Hjem. Jeg skal hjem en liten tur, hun smiler til seg selv og tenker p\\u00e5 hvordan hun plutselig savnet sild. Og akevitt.<\\/p>\\r\\n<p>Det har v\\u00e6rt en lang reise siden hun var i Bangkok, eller lille bangkokk da, gjemt inne i chinatown i london. Der hun fikk noen nye smaker, som aldri hadde v\\u00e6rt innom Trondheim, f\\u00f8r n\\u00e5. Hun klapper p\\u00e5 kofferten som er breddfull av urter, r\\u00f8tter, krydder og oppskrifter hun tar med seg hjem.<br>Men nam prik pao til side, selv om det kanskje er det beste hun hadde smakt, p\\u00e5 alt, hun er klar for sild. Og for svinekj\\u00f8tt. Hun har tenkt mye p\\u00e5 hvordan svinekj\\u00f8ttet fra nettopp tr\\u00f8ndelag vil passe til alle de thailandske smakene, som et avbrekk fra all julematen. Friskt, sterkt, morsomt.<\\/p>\\r\\n<p>Men n\\u00e5 er det r\\u00f8mme som st\\u00e5r i hodet. R\\u00f8mme p\\u00e5 vaffel, med l\\u00f8yrom. Og riskrem. Jossa klarer nesten ikke st\\u00e5 stille hun tripper opp og ned dekk mens de legger landgangen klar.<\\/p>\\r\\n<p>Hjemme, n\\u00e6rmest roper hun n\\u00e5r hun treffer brygga med foten.<\\/p>\\r\\n<p>N\\u00e5 skal det bli godt med gravet fisk.<\\/p>\"}}},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 14:10:01', '2018-01-10 14:10:01', 'a5dee7f7-d7ab-4644-a1e8-98ac0de49433'),
 ('207', '198', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Smak.no om Jossa i Venezuela\",\"slug\":\"smak-no-om-jossa-i-venezuela\",\"postDate\":1515593523,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"197\"],\"10\":\"<p>Smak.no, Dagens N\\u00e6ringslivs matportal har skrevet en flott<b>&nbsp;<a href=\\\"http:\\/\\/www.dn.no\\/smak\\/2016\\/02\\/17\\/1409\\/Restauranter\\/lag-lammebog-med-sramerikansk-vri\\\" target=\\\"_blank\\\">anmeldelse<\\/a>&nbsp;<\\/b>av f\\u00f8rste uken v\\u00e5r i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er tilbake p\\u00e5 hjemmebane i K\\u00f8benhavn, kj\\u00f8rer Jossa videre med meny fra Venezuela fremover! Les teksten<b>&nbsp;<a href=\\\"http:\\/\\/www.dn.no\\/smak\\/2016\\/02\\/17\\/1409\\/Restauranter\\/lag-lammebog-med-sramerikansk-vri\\\" target=\\\"_blank\\\">her<\\/a>.<\\/b><\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Smak.no, Dagens N\\u00e6ringslivs matportal har skrevet en flott<strong>&nbsp;<a href=\\\"http:\\/\\/www.dn.no\\/smak\\/2016\\/02\\/17\\/1409\\/Restauranter\\/lag-lammebog-med-sramerikansk-vri\\\" target=\\\"_blank\\\">anmeldelse<\\/a>&nbsp;<\\/strong>av f\\u00f8rste uken v\\u00e5r i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er tilbake p\\u00e5 hjemmebane i K\\u00f8benhavn, kj\\u00f8rer Jossa videre med meny fra Venezuela fremover! Les teksten<strong>&nbsp;<a href=\\\"http:\\/\\/www.dn.no\\/smak\\/2016\\/02\\/17\\/1409\\/Restauranter\\/lag-lammebog-med-sramerikansk-vri\\\" target=\\\"_blank\\\">her<\\/a>.<\\/strong><\\/p>\"}}},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 14:12:03', '2018-01-10 14:12:03', '0c262b31-1773-47cf-8067-8dbd08919b22'),
 ('208', '198', '3', '49', 'en', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Smak.no om Jossa i Venezuela\",\"slug\":\"smak-no-om-jossa-i-venezuela\",\"postDate\":1515593520,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"197\"],\"10\":\"<p>Smak.no, Dagens N\\u00e6ringslivs matportal har skrevet en flott<strong>&nbsp;<a href=\\\"http:\\/\\/www.dn.no\\/smak\\/2016\\/02\\/17\\/1409\\/Restauranter\\/lag-lammebog-med-sramerikansk-vri\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">anmeldelse<\\/a>&nbsp;<\\/strong>av f\\u00f8rste uken v\\u00e5r i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er tilbake p\\u00e5 hjemmebane i K\\u00f8benhavn, kj\\u00f8rer Jossa videre med meny fra Venezuela fremover! Les teksten<strong>&nbsp;<a href=\\\"http:\\/\\/www.dn.no\\/smak\\/2016\\/02\\/17\\/1409\\/Restauranter\\/lag-lammebog-med-sramerikansk-vri\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">her<\\/a>.<\\/strong><\\/p>\",\"3\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 14:12:30', '2018-01-10 14:12:30', '19bd9415-37fa-4a38-974c-fa9f186b64c4'),
 ('209', '201', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Lokalt grogrunnlag\",\"slug\":\"lokalt-grogrunnlag\",\"postDate\":1515593779,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"200\"],\"10\":\"<p>Jossa setter seg opp i stolen, tar en slurk kaffe og tenker p\\u00e5 hva hun smakte i g\\u00e5r. Det er utvilsomt det beste i Norge sier hun h\\u00f8yt til seg selv. Men hvor g\\u00e5r egentlig grensene for smak, og hvem bestemmer hva som er godt og vondt, fortsetter hun mens koppen snart er tom. Med r\\u00e5varer fra tr\\u00f8ndelag, s\\u00e5 burde man kunne lag hva som helst, men hvem avgj\\u00f8r hva som er best akkurat her ?<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Jossa st\\u00e5r i gangen. Hun har pakket en sekk, tatt p\\u00e5 seg vandreskoene og ikledd seg den fineste turstasen.&nbsp;<\\/p>\\r\\n<p>Drevet av nysgjerrighet g\\u00e5r hun ut, l\\u00e5ser d\\u00f8ra, sjekker at ekstran\\u00f8kkelen ligger under potta, s\\u00e5nn i tilfelle noen skulle trenge noe, snur seg mot huset og sier \\u2013 Jeg g\\u00e5r en tur jeg. Jeg vil finne ut hvor smak kommer fra.&nbsp;<\\/p>\\r\\n<p>Det har med kultur \\u00e5 gj\\u00f8re. Gamle tradisjoner og overbevisninger. Selvsagt har det med lokale grogrunnlag ogs\\u00e5. Jossa tenker mens hun vandrer mot fjorden.<br>Hun setter kursen \\u00f8stover, til et sted som har b\\u00e5de v\\u00e6rt Sverige og Norge.<br>Og det har det v\\u00e6rt flere ganger.&nbsp;<\\/p>\\r\\n<p>Smaken er litt annerledes der. De gj\\u00f8r noe litt annet.&nbsp;<\\/p>\\r\\n<p>Jossa snur seg og ser seg over skulderen. Hun kan s\\u00e5 vidt se gatehj\\u00f8rnet der huset hennes ligger.<br>Ingen vei tilbake n\\u00e5 tenker hun.<\\/p>\"}}},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 14:16:19', '2018-01-10 14:16:19', 'f2ab2a23-cc55-4f59-aeda-fb99ec0190b6'),
