 ('213', '8', '4', '1', 'en', '6', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Finnes\",\"slug\":\"finnes\",\"postDate\":1505469180,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"179\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Velkommen til oss\",\"standardImages\":[\"181\"],\"standardBodyText\":\"<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue.<\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"133\":{\"modified\":\"1\",\"type\":\"introWithOpeningHours\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":\"\",\"standardHeading\":\"\",\"standardBodyText\":\"\"}},\"134\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"55\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"135\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"83\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}}},\"19\":\"1\",\"18\":\"1\"}}', '2018-01-10 14:41:13', '2018-01-10 14:41:13', '50d041b4-17de-4181-96f3-afe45990a2a8'),
 ('214', '69', '4', '49', 'en', '9', '', '{\"typeId\":\"4\",\"authorId\":\"59\",\"title\":\"Meny\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":0,\"parentId\":\"7\",\"fields\":{\"3\":{\"117\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Meny\",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Credo meny 1050,- &nbsp;<br>med vinpakke 2100,-<br><\\/p>\\r\\n<p>Vi tilrettelegger menyer innenfor statens regulativ.<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"118\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"0\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"88\"],\"standardBodyText\":\"<p>Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<br><\\/p>\",\"settingImagePosition\":\"right\"}},\"119\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credo meny 1050,-  \\r\\nmed vinpakke 2100,-\\r\\nLiten Credo meny 830,- \\r\\nmed vinpakke 1660,-\\r\\n\\r\\nVi tilrettelegger menyer innenfor statens regulativ.\\u200b\\u200b\\r\\n\",\"standardBodyText\":\"\"}}},\"19\":\"\",\"18\":\"\"}}', '2018-01-10 14:44:48', '2018-01-10 14:44:48', '33f36ff0-d643-4f16-ad10-45a8ddbd33d1'),
