 ('236', '20', '4', '49', 'en', '8', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":0,\"parentId\":\"9\",\"fields\":{\"3\":{\"144\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Jossa\",\"standardImages\":[\"148\"],\"standardBodyText\":\"<p>P\\u00e5 midten av 1900-tallet bodde det en nysgjerrig, uj\\u00e5lete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne n\\u00e6rmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?<\\/em> Vi tror det var jakten p\\u00e5 de rene smakene. Og mat som ingen hun kjente hadde h\\u00f8rt om f\\u00f8r. Rettene m\\u00e5tte ha jordn\\u00e6r betydning for \\u00e5 smake det lille ekstra, i f\\u00f8lge Jossa. Hun \\u00f8nsket \\u00e5 forst\\u00e5 seg p\\u00e5 verden gjennom mat. Vi er derfor veldig glad og takknemlig for \\u00e5 f\\u00e5 fortsette historiene hennes videre, gjennom Jossa mat og drikke her i Credoveita.<br><\\/p>\",\"settingTextWhiteBox\":\"\"}},\"145\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vi \\u00e5pner i starten av 2018, s\\u00e5 meld deg p\\u00e5 nyhetsbrevet v\\u00e5rt for \\u00e5 motta oppdateringer.\",\"standardBodyText\":\"\"}}},\"21\":\"\",\"19\":\"1\",\"18\":\"1\"}}', '2018-01-10 15:09:39', '2018-01-10 15:09:39', '95c07cb3-00d4-4a4e-9a45-3c01150fffbe'),
