maten, b\\u00f8ndene og dyrene, med kj\\u00f8tt og fisk tilberedt i samme m\\u00e5l, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbr\\u00f8d, andebryst, stekte torskehoder og rabarbraslush.<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"156\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"152\"],\"standardBodyText\":\"<p>Tekst om Heidi&nbsp;En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p\\u00e5 menneskene som maten, b\\u00f8ndene og dyrene, med kj\\u00f8tt og fisk tilberedt i samme m\\u00e5l, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbr\\u00f8d, andebryst, stekte torskehoder og rabarbraslush.<\\/p>\",\"settingImagePosition\":\"right\"}}},\"21\":\"\",\"19\":\"1\",\"18\":\"1\"}}', '2018-01-10 15:09:48', '2018-01-10 15:09:48', '9a53cdc4-f48e-4af4-aa4e-eb3ccf2f99b1'),
 ('238', '141', '3', '49', 'en', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"P\\u00e5 tur til Peru\",\"slug\":\"pa-tur-til-peru\",\"postDate\":1513351020,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"197\"],\"10\":\"<p>P\\u00e5 midten av 1900-tallet bodde det en nysgjerrig, uj\\u00e5lete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne n\\u00e6rmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?<\\/em> Vi tror det var jakten p\\u00e5 de rene smakene. Og mat som ingen hun kjente hadde h\\u00f8rt om f\\u00f8r. Rettene m\\u00e5tte ha jordn\\u00e6r betydning for \\u00e5 smake det lille ekstra, i f\\u00f8lge Jossa.<br><\\/p>\",\"3\":\"\",\"21\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 15:31:20', '2018-01-10 15:31:20', '0d72f9e3-88f2-4a3f-be67-5ac721be352b'),
 ('239', '9', '4', '49', 'en', '15', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Jossa\",\"slug\":\"jossa\",\"postDate\":1505469240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"177\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Jossa\",\"standardImages\":[\"146\"],\"standardBodyText\":\"<p>Jossa er et&nbsp;rustikk alternativ til Credo, og endrer meny ut i fra hvor Jossa reiser.<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"142\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"141\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"203\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"189\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"204\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"201\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"205\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"198\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"206\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"192\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"207\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"195\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}}},\"21\":\"\",\"19\":\"1\",\"18\":\"1\"}}', '2018-01-10 15:38:18', '2018-01-10 15:38:18', '344d93b1-d0f5-4d01-8786-b2821a635f1c'),
 ('240', '198', '3', '49', 'en', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Smak.no om Jossa i Venezuela\",\"slug\":\"smak-no-om-jossa-i-venezuela\",\"postDate\":1515593520,\"expiryDate\":null,\"enabled\":0,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"197\"],\"10\":\"<p>Smak.no, Dagens N\\u00e6ringslivs matportal har skrevet en flott<strong>&nbsp;<a href=\\\"http:\\/\\/www.dn.no\\/smak\\/2016\\/02\\/17\\/1409\\/Restauranter\\/lag-lammebog-med-sramerikansk-vri\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">anmeldelse<\\/a>&nbsp;<\\/strong>av f\\u00f8rste uken v\\u00e5r i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er tilbake p\\u00e5 hjemmebane i K\\u00f8benhavn, kj\\u00f8rer Jossa videre med meny fra Venezuela fremover! Les teksten<strong>&nbsp;<a href=\\\"http:\\/\\/www.dn.no\\/smak\\/2016\\/02\\/17\\/1409\\/Restauranter\\/lag-lammebog-med-sramerikansk-vri\\\" target=\\\"_blank\\\" rel=\\\"noreferrer noopener\\\">her<\\/a>.<\\/strong><\\/p>\",\"3\":\"\",\"21\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 15:46:14', '2018-01-10 15:46:14', 'aa981d76-f8c6-4b43-b1da-4b64b5d892ee'),
 ('241', '211', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Viva Mexico\",\"slug\":\"viva-mexico\",\"postDate\":1515599376,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"210\"],\"10\":\"<p>Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k. Jossa har savnet tropiske frukter, de eksotiske smakene og ikke minst de livlige rytmene \\u2013 Mexico, watch out!<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Jossa ser ut over skyene og dr\\u00f8mmer om deilig salsa, tamales, mole og for ikke \\u00e5 glemme den mexicanske guacemolen. Hun klarer nesten ikke \\u00e5 sitte stille, og kjenner hun er klar for \\u00e5 sette beina p\\u00e5 meksikans jord.<br><\\/p>\\r\\n<p>P\\u00e5 let etter ny inspirasjon trekker Jossa pusten idet havbrisen glir forbi og sandkornene kiler lett under f\\u00f8ttene. Endelig i Mexico, and first \\u2013 TACOS!\\r\\n  <\\/p>\"}}},\"21\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 15:49:36', '2018-01-10 15:49:36', 'd7fc69ac-f756-4454-a207-99a84cce094c'),
 ('242', '214', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Jossa p\\u00e5 vei til Thailand & Laos\",\"slug\":\"jossa-pa-vei-til-thailand-laos\",\"postDate\":1515599509,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"213\"],\"10\":\"<p>Vel tilbake fra Mexico ble ikke lysten p\\u00e5 eventyr mettet for Jossa.<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Koffertene er ikke ferdig utpakket f\\u00f8r at utstyret pakkes ned igjen og nye reisem\\u00e5l st\\u00e5r for tur, for savnet etter de friske urtene, sterke kryddrene og de lekne smakene f\\u00f8rer Jossa til big Thailand og Laos!<\\/p>\\r\\n<p>Nam prik pao, pad thai og gaeng phed ped yang er bare noen av rettene som st\\u00e5r p\\u00e5 smaksagendaen for reisen, og Jossa f\\u00e5r vann i munnen av tanken.<\\/p>\"}}},\"21\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 15:51:49', '2018-01-10 15:51:49', '53376a0a-f8e4-4ecf-9cf4-4b43e5be20d9'),
 ('243', '217', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Gr\\u00f8nne omgivelser \",\"slug\":\"gronne-omgivelser\",\"postDate\":1515599795,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"216\"],\"10\":\"<p>Vel i hus p\\u00e5 Finnes Kaf\\u00e9 s\\u00e5 blomstrer det for fullt i parsellhagen p\\u00e5 Lilleby.<br><\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Friske urter, nydelige blomster og nyttevekster som folk flest bare kan dr\\u00f8mme om er lett tilgjengelig like utenfor d\\u00f8ra \\u2013 For en LUKSUS!<\\/p>\\r\\n<p>Lilleby Hagelag, i samarbeid med kretsl\\u00f8psg\\u00e5rden Skj\\u00f8lberg S\\u00f8ndre holder hagen i sjakk, og til v\\u00e5r forn\\u00f8yelse s\\u00f8rger de for friske og gr\\u00f8nne omgivelser rundt Finnes Kaf\\u00e9, Jossa mat & drikke og Credo Restaurant.<\\/p>\\r\\n<p>Alle som \\u00f8nsker kan bli med i Lilleby Hagelag, og for mer informasjon, ta kontakt p\\u00e5 <a href=\\\"mailto:post@lillebyhagelag.no\\\">post@lillebyhagelag.no<\\/a><\\/p>\\r\\n<p>&nbsp;\\r\\n  <\\/p>\"}}},\"21\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 15:56:35', '2018-01-10 15:56:35', '9f8feb9e-fb5e-4845-81d6-bdeb217c6a2b'),
 ('244', '222', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Finnes bakeri\",\"slug\":\"finnes-bakeri\",\"postDate\":1515600053,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":\"\",\"4\":[\"221\"],\"10\":\"<p>Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes Kaf\\u00e9 i September 2017.<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"220\"],\"standardBodyText\":\"<p>Bakeriet har fokus p\\u00e5 naturlig hevet br\\u00f8d \\u2013 SURDEIGSBR\\u00d8D \\u2013 og br\\u00f8dene er utelukkende laget p\\u00e5 norsk mel og kornarter. Spelt, Havre, Emmer, og r\\u00f8kt bygg er bare noen alternativer som er \\u00e5 f\\u00e5 p\\u00e5 kafeen.<\\/p>\\r\\n<p>&nbsp;*Ille Br\\u00f8d Surdeigsbakeri (<a href=\\\"https:\\/\\/www.facebook.com\\/illebrod\\/)\\\">https:\\/\\/www.facebook.com\\/illebrod\\/)<\\/a> er et surdeigsbakeri lokalisert i Oslo. De lager naturlig hevet br\\u00f8d og tar utelukkende i bruk lokalt dyrket mel og urkorn. Bakeriet holder til i Lakkegata 53, Oslo, og vi anbefaler hele Oslos befolkning, og alle tilreisende \\u00e5 ta turen innom bakeriet for en smak av byens beste br\\u00f8d!<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 16:00:53', '2018-01-10 16:00:53', 'a852e0f3-93d7-474d-9ede-7268cc7de0ea'),
 ('245', '226', '3', '49', 'en', '1', '', '{\"typeId\":null,\"authorId\":\"49\",\"title\":\"Fossan Br\\u00f8d\",\"slug\":\"fossan-brod\",\"postDate\":1515600220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"224\"],\"10\":\"<p>Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.<\\/p>\",\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Den ble til da selve turbinen m\\u00f8llen best\\u00e5r av, ble fraktet med jernbane til Hegra, og&nbsp;deretter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan M\\u00f8lle av Petter Fossan,&nbsp;og matmel blir fortsatt malt i denne gamle m\\u00f8lla. Finnes Kaf\\u00e9 \\u00f8nsker \\u00e5 sette lys p\\u00e5 denne gamle perlen, og til v\\u00e5r store begeistring f\\u00e5r vi oppdage melet i br\\u00f8dbaksten v\\u00e5r. Vi har utforsket med ulike melsorter fra Fossan M\\u00f8lle, og eksperimentene har resultert i et eget \\u201dFossan Br\\u00f8d\\u201d som er til salgs i kafeen!<\\/p><p><\\/p>\"}}},\"21\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 16:03:40', '2018-01-10 16:03:40', 'b7d0004e-5193-4087-9862-4020f419b3f0'),
 ('246', '222', '3', '49', 'en', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Finnes bakeri\",\"slug\":\"finnes-bakeri\",\"postDate\":1515600000,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"221\"],\"10\":\"<p>Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes Kaf\\u00e9 i September 2017.<\\/p>\",\"3\":{\"223\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"220\"],\"standardBodyText\":\"<p>Bakeriet har fokus p\\u00e5 naturlig hevet br\\u00f8d \\u2013 SURDEIGSBR\\u00d8D \\u2013 og br\\u00f8dene er utelukkende laget p\\u00e5 norsk mel og kornarter. Spelt, Havre, Emmer, og r\\u00f8kt bygg er bare noen alternativer som er \\u00e5 f\\u00e5 p\\u00e5 kafeen.<\\/p>\\r\\n<p>&nbsp;*Ille Br\\u00f8d Surdeigsbakeri (<a href=\\\"https:\\/\\/www.facebook.com\\/illebrod\\/)\\\">https:\\/\\/www.facebook.com\\/illebrod\\/)<\\/a> er et surdeigsbakeri lokalisert i Oslo. De lager naturlig hevet br\\u00f8d og tar utelukkende i bruk lokalt dyrket mel og urkorn. Bakeriet holder til i Lakkegata 53, Oslo, og vi anbefaler hele Oslos befolkning, og alle tilreisende \\u00e5 ta turen innom bakeriet for en smak av byens beste br\\u00f8d!<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":\"\",\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-01-10 16:03:51', '2018-01-10 16:03:51', '2f3daf02-07e1-4038-8ea8-cfb2e88a0cab'),
 ('247', '8', '4', '49', 'en', '11', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Finnes\",\"slug\":\"finnes\",\"postDate\":1505469180,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"179\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Velkommen til oss\",\"standardImages\":[\"209\"],\"standardBodyText\":\"<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue.<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"133\":{\"modified\":\"1\",\"type\":\"introWithOpeningHours\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":\"\",\"standardHeading\":\"\",\"standardBodyText\":\"\"}},\"new2\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"226\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"new0\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"217\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"new1\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"222\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}}},\"21\":\"\",\"19\":\"1\",\"18\":\"1\"}}', '2018-01-10 16:04:52', '2018-01-10 16:04:52', '52317c45-3e0f-40f7-ac57-d025902bdbd8'),
